INSERT INTO spree_pages VALUES(3,'Vorstellung','','/vorstellung','2023-05-16 19:39:15.715107','2023-08-11 22:02:28.142082',0,0,NULL,2,1,NULL,NULL,NULL,0,NULL,0,0);
INSERT INTO spree_pages VALUES(4,'Ziele',replace(replace('<p>Der Verein hat sich zum Ziel gesetzt, Menschen mit &auml;hnlichen Interessen zu verbinden und diese in den Bereichen Shibari, Technik und Handwerk, Bewegungsoptimierung und &Auml;sthetik zu f&ouml;rdern. Dabei spielt die europ&auml;ische Interpretation der japanischen &Auml;sthetik eine wichtige Rolle.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Besonders wichtig ist dem Verein, dass seine Mitglieder ein fundiertes Sicherheitswissen erlangen, sowohl praktisch als auch theoretisch. Au&szlig;erdem erhalten sie Zugang zu medizinischen und rechtlich relevanten Themen sowie aktuellen Diskussionen. Letztendlich gibt es mit allen Themenbereichen Schnittmengen zur Sicherheit, was dem Verein sehr am Herzen liegt.</p>\r\n','\r',char(13)),'\n',char(10)),'/ziele','2023-05-16 19:40:35.524052','2023-08-11 22:02:28.142082',0,0,NULL,3,1,NULL,NULL,NULL,0,NULL,0,0);
INSERT INTO spree_pages VALUES(5,'Trainer',replace(replace('<p>- Einladung zur Selbstvorstellung mit Termin/Fristsetzung</p>\r\n','\r',char(13)),'\n',char(10)),'/trainer','2023-05-16 19:40:45.848735','2023-08-11 22:02:28.142082',0,0,NULL,4,1,NULL,NULL,NULL,0,NULL,0,0);
INSERT INTO spree_pages VALUES(6,'Mitgliedschaften',replace(replace('<p>Wir haben Vereinsmitgliedschaften, wie Ihr es aus anderen Vereinen kennt. Diese werden in der Regel von dem/ der Rigger*in bezahlt und beinhalten selbstverst&auml;ndlich ein Mitbringen von Trainingspartner*innen. Anfangs empfehlen wir Tagesmitgliedschaften zu nutzen und erst in der Verein einzutreten, wenn sich eine gewisse Regelm&auml;&szlig;igkeit abzeichnet.<br />\r\n<br />\r\nTagesmitgliedschaften:<br />\r\n<br />\r\nEine Trainingseinheit kostet 20&euro;.<br />\r\n<br />\r\nBeispiel 1. Da sich die Vereinsmitgliedschaften insbesondere an Rigger*innen richten, welche mit verschiedenen Trainingspartener*innen kommen k&ouml;nnen, wird in der Regel die Tagesmitgliedschaft von Rigger*innen &uuml;bernommen.<br />\r\n<br />\r\nBeispiel 2: H&auml;ufig finden sich Leute zum &quot;switchen&quot;. Dann k&ouml;nnt ihr euch die Kosten teilen. Euch entstehen dadurch keine weiteren kosten.<br />\r\n<br />\r\nBeispiel 3. Switchen mit Vereinsmitglied. Kostet 10&euro; pro Trainingseinheit</p>\r\n','\r',char(13)),'\n',char(10)),'/mitglied-werden','2023-05-16 19:40:55.330802','2023-08-11 22:02:28.142082',0,0,NULL,5,1,NULL,NULL,NULL,0,NULL,0,0);
