INSERT INTO spree_pages VALUES(8,'Vor dem ersten Besuch',replace(replace('<p>Erster Besuch</p>\r\n','\r',char(13)),'\n',char(10)),'/erster-besuch','2023-05-16 19:42:07.429185','2023-08-11 22:02:28.142082',0,0,NULL,7,1,NULL,NULL,NULL,0,NULL,0,0);
INSERT INTO spree_pages VALUES(10,'Level und Prüfungen',replace(replace('<p>Als Verein halten wir uns an strenge Pr&uuml;fungsrichtlinien, &auml;hnlich wie im traditionellen Kampfsport in Japan. Wir offerieren regelm&auml;&szlig;ige Pr&uuml;fungen (Kyu) f&uuml;r unsere Sch&uuml;ler:innen und f&ouml;rdern durch diesen Prozess eine kontinuierliche Verbesserung der eigenen motorischen Fertigkeiten.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Je 3 Level pro Stufe</p>\r\n\r\n<p>- Einsteiger (Kyu 9-7)</p>\r\n\r\n<p>- Mittelstufe (Kyu 6-4)</p>\r\n\r\n<p>- Fortgeschrittene (Kyu 3-1)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>- Level werden mit Pr&uuml;fungen abgeschlossen</p>\r\n\r\n<p>- Erzeugung k&uuml;nstlicher Stresssituationen, zur Vorbereitung</p>\r\n\r\n<p>- bis Fortgeschritten-Level finden die Pr&uuml;fungen unter Zeitdruck statt</p>\r\n\r\n<p>- zeigt der/die Sch&uuml;ler:in, dass die Techniken in Stresssituationen abrufbar sind</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Grundstufe</p>\r\n\r\n<p>- Umgang mit dem Seil</p>\r\n\r\n<p>- Basishandgriffe verinnnerlichen</p>\r\n\r\n<p>- Einf&uuml;hrung in Semi-Suspension</p>\r\n\r\n<p>- Einf&uuml;hrung in jap. &Auml;sthetik</p>\r\n\r\n<p>- Einf&uuml;hrung in untersch. Fesselintentionen</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mittelstufe</p>\r\n\r\n<p>- sicherer Umgang mit Suspensionen</p>\r\n\r\n<p>- ...</p>\r\n\r\n<p>Fortgeschrittene</p>\r\n\r\n<p>- komplexere Fesselungen</p>\r\n\r\n<p>- Vertiefung Fesselintentionen</p>\r\n','\r',char(13)),'\n',char(10)),'/level-und-pruefungen','2023-05-16 19:42:44.435974','2023-08-11 22:02:28.142082',0,0,NULL,8,1,NULL,NULL,NULL,0,NULL,0,0);
INSERT INTO spree_pages VALUES(11,'Sicherheit und Risiken',replace(replace('<p>Fesseln ist gef&auml;hrlich. Deshalb ist es besonders wichtig, sich mit den Risiken auseinanderzusetzen. So kann f&uuml;r alle Beteiligten ein sicheres und gutes Erlebnis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>- Sicherheitsausr&uuml;stung</p>\r\n\r\n<p>- Scheren/Schneidwerkzeug (und deren Begr&uuml;ndung)</p>\r\n\r\n<p>- Wissen reduziert Risiken</p>\r\n\r\n<p>- Anatomie (Blutbahnen, Nerven, Gelenke, Muskeln)</p>\r\n','\r',char(13)),'\n',char(10)),'/sicherheit-und-risiko','2023-05-16 19:43:37.067521','2023-08-11 22:02:28.142082',0,0,NULL,9,1,NULL,NULL,NULL,0,NULL,0,0);
INSERT INTO spree_pages VALUES(12,'Konsent',replace(replace('<p>Konsent stellt die Frage: Wer macht was f&uuml;r wen wie lange?</p>\r\n\r\n<p>- Konsent vs. Consent (denkhilfe)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Wir halten die aktiv- und passiv-Konzepte im Konsens f&uuml;r l&uuml;ckenhaft.</p>\r\n\r\n<p>Aktiv - Geber / Passiv - Nehmer</p>\r\n\r\n<p>Es kommt vielmehr zu Wechselwirkungen zwischen &sbquo;aktiv&lsquo; und &sbquo;passiv&lsquo; - es lohnt also die Dynamiken genauer zu hinterfragen.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>- Orientierung am &sbquo;Wheel of consent&lsquo; (Betty Martin)</p>\r\n\r\n<p>A</p>\r\n\r\n<p>Fesselnde P als Beschenkte</p>\r\n\r\n<p>Gefesselte P als Schenkende</p>\r\n\r\n<p>B</p>\r\n\r\n<p>Fesselnde P als Schenkende</p>\r\n\r\n<p>Gefesselte P als Beschenkte</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name="_GoBack"></a> A und B sind m&ouml;gliche Varianten im Konsent, die sich bei jeder einzelnen Handlung ver&auml;ndern k&ouml;nnen.</p>\r\n','\r',char(13)),'\n',char(10)),'/consent','2023-05-16 19:43:45.993005','2023-08-11 22:02:28.142082',0,0,NULL,10,1,NULL,NULL,NULL,0,NULL,0,0);
INSERT INTO spree_pages VALUES(13,'Konsent im Workshop und Training',replace(replace('<p>- Ber&uuml;hrungen durch Trainer (nicht st&auml;ndig erneutes Erfragen)</p>\r\n\r\n<p>- Konkretes Fragen:</p>\r\n','\r',char(13)),'\n',char(10)),'/consent-im-workshop-und-training','2023-05-16 19:44:01.938501','2023-08-11 22:02:28.142082',0,0,NULL,11,1,NULL,NULL,NULL,0,NULL,0,0);
INSERT INTO spree_pages VALUES(14,'Training und Workshops',replace(replace('<p>Das Wissen wird &auml;hnlich wie in einem Kampfsportverein vermittelt. Es gibt mehrere Stufen die mit der Zeit erreicht werden k&ouml;nnen. Zun&auml;chst werden Grundlagen vermittelt, z.B.: Einhand-Fesselung, Zweihand-Fesselungen etc. Danach folgen darauf aufbauende komplexere Fesselungen. Teilnehmende lernen in ihrem eigenen Tempo, nicht durch Frontalunterricht. Dabei wird nicht nur auf die Technik geachtet, sondern auch auf die Haltung. Das K&ouml;nnen spiegelt sich also nicht nur im theoretischen Verstehen sondern auch in der praktischen Anwendung wieder. Erst wenn eine Technik intensiv verinnerlicht wurde, wird zum n&auml;chsten Schritt &uuml;bergeleitet. Der Unterricht im Dojo unterscheidet sich dadurch von Workshop-Konzepten.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ziel ist es, &uuml;ber Regelm&auml;&szlig;igkeit und konstante Wiederholungen eine Routine im Fesseln zu erreichen, die es erlaubt den Partner schnell, effizient und mit gr&ouml;&szlig;tm&ouml;glicher Sicherheit einzufangen.<br />\r\n&nbsp;</p>\r\n\r\n<p>Ein weiteres Ziel des Trainings ist es, das Muskelged&auml;chtnis zu schulen, um eine m&ouml;glichst hohe Sicherheit zu gew&auml;hrleisten und Risiken zu minimieren. Hierf&uuml;r werden den Mitgliedern grundlegende Kenntnisse in Anatomie und Physiologie vermittelt. Durch gezielte Wiederholung einzelner &Uuml;bungen entsteht Routine, die in Gefahrensituationen Ruhe und Sicherheit gibt. Im Austausch mit praktizierenden Mediziner:innen wird eine versierte Herangehensweise vermittelt.</p>\r\n\r\n<p><br />\r\nDie Teilnahme am Training ist nur als Paar m&ouml;glich, ihr braucht also jemanden, der euch begleitet.<br />\r\n<br />\r\nJede Person, die aktiv bei uns fesseln lernen m&ouml;chte, muss einmalig ein Startertraining besuchen. Hier bekommt ihr alle Infos, die die Ihr zum Trainieren bei uns ben&ouml;tigt und bekommt einen Eindruck von unserem Unterricht. Anschlie&szlig;end seid k&ouml;nnt ihr an jedem Grundstufentraining teilnehmen.</p>\r\n','\r',char(13)),'\n',char(10)),'/training-und-workshops','2023-05-16 19:44:38.795541','2023-08-11 22:02:28.142082',0,0,NULL,13,1,NULL,NULL,NULL,0,NULL,0,0);
