INSERT INTO spree_pages VALUES(20,'Einführungsveranstaltung',replace(replace('<p>Die Einf&uuml;hrungsveranstaltung dient als Grundlage f&uuml;r den Unterricht im Osada Kinbaku Dojo Berlin, kann aber auch Eigenst&auml;ndig als Workshop f&uuml;r Fesselinteressierte wahrgenommen werden. Durch die Einf&uuml;hrungsveranstaltung wollen wir sicherstellen, dass alle, die bei uns unterrichtet werden, &uuml;ber z.B.: sicherheitsrelevante Aspekte Informiert sind, aber auch vereinsinterne Regelungen kennen. Dies nimmt vorab etwas Zeit in Anspruch, daher gliedern wir die Einf&uuml;hrungsveranstaltung vom w&ouml;chentlichen Training ab.&nbsp;Die Einf&uuml;hrungsveranstaltung ist die Voraussetzung um bei unserem Grundstufen Training teilnehmen zu k&ouml;nnen.<br />\r\n<br />\r\nDie Einf&uuml;hrungsveranstaltung wird &uuml;berwiegend frontal unterrichtet und unterscheidet sich daher sehr von dem gew&ouml;hnlichen Training.<br />\r\n<br />\r\nWir starten mit einem theoretischen Teil<br />\r\n<br />\r\n-&Uuml;berblick: Sicherheit und Consent<br />\r\n-&Uuml;berblick: Materialkunde<br />\r\n-&Uuml;berblick: Medizinische Themen<br />\r\n-Informationen &uuml;ber den Verein<br />\r\n-Informationen zu Trainingsmethoden<br />\r\n-Informationen zu unserem Pr&uuml;fungssystem<br />\r\n<br />\r\nDann legen wir mit der Praxis los.<br />\r\n<br />\r\n-Praxisteil: Ihr lernt alle Elemente der ersten Stufe (Kyu9) in unserem Schulsystem. Wir empfehlen diese Techniken in unseren Trainingsstunden zu vertiefen.<br />\r\n<br />\r\n-Demoteil. Kurze Demo, wie man die gelernten Elemente einsetzten k&ouml;nnte&nbsp;<img src="file:///tmp/lu4422rt672j.tmp/lu4422rt6739_tmp_1d3b81b6593dcee6.gif" style="height:18px; width:18px" /><br />\r\n<br />\r\nDie Trainingsstunden sind dann mit unterschiedlichen Leveln im gleichen Raum. Im Training werden sp&auml;ter die Lerninhalte in 1-1 Situationen vertieft. Mehr erfahrt ihr bei unserer Einf&uuml;hrungsveranstaltung. Bis Bald!<br />\r\n<br />\r\nLiebe Gr&uuml;&szlig;e<br />\r\n<br />\r\nEuer Team von Osada Kinbaku Berlin e.V.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>N&auml;chste Termine (Liinks zum &sbquo;Shop&lsquo;)</p>\r\n','\r',char(13)),'\n',char(10)),'/einfuehrungsveranstaltung','2023-05-16 21:09:37.210451','2023-08-11 22:02:28.142082',0,0,NULL,12,1,NULL,NULL,NULL,0,NULL,0,0);
