INSERT INTO spree_content_blocks VALUES(10,3,'richtext_image_right','Vereinsvorstellung mit Bild',replace(replace('<p>Herzlich willkommen auf der Website des Osada Kinbaku Dojo e.V., dem Ort f&uuml;r Shibari-Begeisterte in Berlin!</p>\r\n\r\n<p>Unser gemeinn&uuml;tziger Verein widmet sich der Vermittlung der japanischen Seilkunst Shibari - auch bekannt als Kinbaku - sowie der Schaffung einer Gemeinschaft von Menschen, die sich f&uuml;r Kunst, K&ouml;rperarbeit und Selbstentwicklung interessieren. Unser Shibari-Dojo bietet regelm&auml;&szlig;ige Unterrichtseinheiten und Workshops an, die das Erlernen und Verfeinern von Techniken und Fertigkeiten im Umgang mit Seilen erm&ouml;glichen. Dabei legen wir besonderen Wert auf k&ouml;rperliche und seelische Gesundheit sowie das Respektieren der Grenzen anderer.</p>\r\n\r\n<p>Wir unterrichten Shibari in Theorie und Praxis nach einer klassischen Form des Osada Ryu unterrichtet. Hierbei orientieren wir uns an der Interpretation einer &auml;lteren Form des Osada Ryu.</p>\r\n\r\n<p>Wir laden Euch herzlich ein, uns auf unserer Website unsere Leidenschaft und unser Dojo kennen zu lernen und in die faszinierende Welt des Shibari einzutauchen.</p>\r\n\r\n<p>Au&szlig;erdem findet Ihr hier auch allgemeine Informationen zu Shibari.</p>\r\n\r\n<p>Schaut Euch um und lernt uns kennen - wir freuen uns auf Euch!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sportliche Gr&uuml;&szlig;e,</p>\r\n\r\n<p><em>Das Team des Osada Kinbaku Dojo e.V.</em></p>\r\n','\r',char(13)),'\n',char(10)),1,90,'2023-05-17 15:49:44.998069','2023-05-17 15:51:27.187064',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
